// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.2 <0.9.0;




contract CardInventory {
    mapping(address => mapping(uint => uint)) private cardBalances;


    function addCard(address user, uint cardId, uint amount) external {
        cardBalances[user][cardId] += amount;
    }


    function removeCard(address user, uint cardId, uint amount) external {
        require(cardBalances[user][cardId] >= amount, "Not enough cards");
        cardBalances[user][cardId] -= amount;
    }


    function getBalance(address user, uint cardId) external view returns (uint) {
        return cardBalances[user][cardId];
    }
}

